import { Link } from 'react-router-dom'
import Bin from "../../multimedia/png/bin.png"
import { deleteData } from "../../Services/CRUD"

const TicketCard = ({expense}) => {

    const handleDelete = async (id) => {
        await deleteData("tickets", id)
    }
    if (expense.amount >= 10) {
        return (
            <div className='m-2 flex justify-around'>
            <Link to={`/ticket/${expense.id}`}>
                <div className='flex flex-row justify-between'>
                    <h3 className='font-medium text-lg m-2 mx-4'>{expense.subindex}</h3>
                    <p className='m-2 mx-4'>${expense.amount}</p>
                     <p className='m-2 mx-4'>{expense.concept}</p>
                     <p className='m-2 mx-4'>{expense.date}</p>
                </div>
            </Link>
            <button onClick={() => handleDelete(expense.id)}>
                <img src={Bin} alt="delete icon" className="h-6" />
            </button>
            </div>
        )
    }
}

export default TicketCard
